function News(){}News.prototype.listenUploadFileEvent=function(){var n=$("#thumbnail-btn");n.change(function(){var t=n[0].files[0],e=new FormData;e.append("file",t),sdbuajax.post({url:"/cms/upload_file/",data:e,processData:!1,contentType:!1,success:function(t){var e;200===t.code&&(e=t.data.url,$("#InputImage").val(e))}})})},News.prototype.initUEditor=function(){window.ue=UE.getEditor("editor",{initialFrameHeight:400,serverUrl:"/ueditor/upload/"})},News.prototype.run=function(){this.initUEditor(),this.listenUploadFileEvent()},$(function(){(new News).run()});